'use strict';
class PdasMessage {
    msgType;
    children;
    getType() {
        return this.msgType;
    }
    serialize() {
        let result;
        result = "<m t=\"" + this.msgType + "\" s=\"" + (this.children.length()).toString() + "\" q=\"0\">" + this.children.serialize() + "</m>";
        return result;
    }
    addChild(item) {
        this.children.addChild(item);
    }
    getFieldValue(name) {
        return this.children.getFieldValue(name);
    }
    getList(name) {
        return this.children.getList(name);
    }
    getGroupParamValueByParamName(name) {
        return this.children.getGroupParamValueByParamName(name);
    }
    getFields() {
        return this.children.getFields();
    }
    getGroups() {
        return this.children.getGroups();
    }
    length() {
        return this.children.length();
    }
    getElementType() {
        return "m";
    }
}
module.exports = PdasMessage
